import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemSecondaryAction from '@material-ui/core/ListItemSecondaryAction';
import ListItemText from '@material-ui/core/ListItemText';
import Avatar from '@material-ui/core/Avatar';
import IconButton from '@material-ui/core/IconButton';
import Grid from '@material-ui/core/Grid';
import EditIcon from '@material-ui/icons/Edit';

import Whiskas from '../../images/whiskas.jpg';
import Zeep from '../../images/zeep.jpg';
import Strokorrel from '../../images/strokorrel.png';
import { Typography } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 752,
    marginLeft: '10ch',
    marginRight: '5ch'
  },
  demo: {
    backgroundColor: theme.palette.background.paper,
  },
  title: {
    margin: theme.spacing(4, 0, 2),
  },
  listitem: {
      marginBottom: '0ch',
  },
  listItemText:{
    fontSize: '24px'
  }
}));

export default function InteractiveList() {
  const classes = useStyles();
  const [dense] = React.useState(false);
  const [secondary] = React.useState(false);

  return (
    <div className={classes.root}>
        <Grid item xs={12}>
          <div className={classes.demo}>
            <List dense={dense}>
                <ListItem className={classes.listitem}>
                  <ListItemAvatar>
                    <Avatar>
                      <img src={Zeep} alt="not found" width="40" height="40"/>
                    </Avatar>
                  </ListItemAvatar>
                  <ListItemText>
                      <Typography>

                      </Typography>
                  </ListItemText>
                  <ListItemSecondaryAction>
                    <IconButton edge="end" aria-label="edit">
                      <EditIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
                <ListItem>
                  <ListItemAvatar>
                    <Avatar>
                        <img src={Strokorrel} alt="not found" width="40" height="40"/>
                    </Avatar>
                  </ListItemAvatar>
                  <ListItemText
                    primary="Happy Home Strokorrel"
                    secondary={secondary ? 'Secondary text' : null}
                    variant="h2"
                  />
                  <ListItemSecondaryAction>
                    <IconButton edge="end" aria-label="edit">
                      <EditIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
                <ListItem>
                  <ListItemAvatar>
                    <Avatar>
                        <img src={Whiskas} alt="not found" width="40" height="40"/>
                    </Avatar>
                  </ListItemAvatar>
                  <ListItemText
                    primary="Whiskas brokjes junior"
                    secondary={secondary ? 'Secondary text' : null}
                  />
                  <ListItemSecondaryAction>
                    <IconButton edge="end" aria-label="edit">
                      <EditIcon />
                    </IconButton>
                  </ListItemSecondaryAction>
                </ListItem>
            </List>
          </div>
        </Grid>
    </div>
  );
}
